Let's think step-by-step about a computational model for responder behavior in this bargaining game.

**Key Psychological Mechanisms:**

1. **Equity/Fairness:**  Responders are likely sensitive to the fairness of the offer, considering both the absolute amount received (`split_self`) and the proportional share relative to contributions (`split_perc_self` and the ratio of tokens).  Inequity aversion is a well-established psychological principle.

2. **Self-Interest:** Responders will prioritize maximizing their own monetary gain. This is captured by the absolute amount offered (`split_self`).

3. **Relative Contributions:** The relative contributions of the participants (token_self / (token_self + token_opp)) plays a crucial role in judging fairness.  An offer that seems fair when contributions are equal might seem unfair when contributions are unequal.


**How These Mechanisms Interact:**

The model should incorporate both fairness and self-interest.  The relative contributions should moderate the impact of both absolute and proportional fairness considerations.  A highly unequal contribution might lead to a higher acceptance threshold for proportional fairness, while a more equal contribution might lead to lower tolerance for unequal splits.

**Mathematical Form:**

A multiplicative model can capture these interactions effectively. The utility of accepting an offer can be modeled as the product of the absolute gain and a fairness term modulated by the relative contributions.  This allows the influence of fairness to vary depending on the contribution ratio.

**Parameters:**

1.  `gain_weight`: This parameter reflects the importance of the absolute monetary gain to the responder. A higher value indicates a greater emphasis on self-interest. (Learnable)

2. `fairness_sensitivity`: This parameter captures the responder's sensitivity to fairness. A higher value indicates a greater aversion to unfair offers (Learnable).

**Mapping to Observable Behavior:**

Higher values of `gain_weight` will lead to higher utility for larger offers, regardless of fairness. Higher values of `fairness_sensitivity` will penalize offers perceived as unfair, reducing utility even if the absolute monetary gain is substantial. The interaction of these parameters with the relative contribution ratio will determine the acceptance threshold for different offers.

