def simulate_model(trial_data, gain_weight=1, fairness_sensitivity=1):
    utility_values = []
    for trial in trial_data:
        try:
            split_self = trial['split_self']
            split_perc_self = trial['splitperc_self']
            token_self = trial['token_self']
            token_opp = trial['token_opp']

            #Handle potential division by zero
            if token_self + token_opp == 0:
                relative_contribution = 0  # or handle it in another way if appropriate
            else:
                relative_contribution = (token_self / (token_self + token_opp)) * 100

            utility = gain_weight * split_self * (1 - fairness_sensitivity * abs(split_perc_self - relative_contribution))
            utility_values.append(utility)
        except KeyError as e:
            print(f"Error processing trial: Missing key {e}. Skipping trial.")
            utility_values.append(None) # or handle missing data appropriately
    return utility_values
